'''
387. First Unique Character in a String

Given a string s, find the first non-repeating character in it and return its index. If it does not exist, return -1.

 

Example 1:

Input: s = "leetcode"
Output: 0
Example 2:

Input: s = "loveleetcode"
Output: 2
Example 3:

Input: s = "aabb"
Output: -1
 

Constraints:

1 <= s.length <= 105
s consists of only lowercase English letters.
'''

class Solution:
    def firstUniqChar(self, s: str) -> int:
        # Dicionário para contar as ocorrências de cada caractere
        # Dictionary to count occurrences of each character

        char_count = {}
        
        # Contagem das ocorrências de cada caractere
        # Count occurrences of each character
        for char in s:
            if char in char_count:
                char_count[char] += 1
            else:
                char_count[char] = 1

        # Encontrar o primeiro caractere único e retornar seu índice
        # Find the first unique character and return its index
        for i, char in enumerate(s):
            if char_count[char] == 1:
                return i
        
        # Se nenhum caractere único for encontrado, retornar -1
        # If no unique character is found, return -1
        return -1
        
print(Solution().firstUniqChar('leetcode'))
print(Solution().firstUniqChar('loveleetcode'))
print(Solution().firstUniqChar('aabb'))
